import React from "react";

export default function AddCollection(props) {
  let listColors = ["pink", "yellow", "orange", "red", "purple", "blue"];

  let displayVal = props.displayVal;
  return (
    <div className="AddCollection w-100 h-100 m-auto position-fixed" style = {{
        display : `${displayVal ? "flex" : "none"}`,
        top : "0",
        left : "0",
    }}>
      <div className="addCollection__bg w-100 h-100" style = {{
          backgroundColor : "#000",
          opacity : "50%",
      }}></div>

      <div className="addCollection__content w-100 h-100 p-4 position-absolute" style = {{
          border : "1px solid #000",
      }}>
        <div className="content">
        <div className="addCollection__top">
          <div className="addCollection__caption">add collection</div>
          <div className="addCollection__close-btn">
            <ion-icon name="close"></ion-icon>
          </div>
        </div>

        <div className="addCollection__bar bar-name">
          <div className="addCollection__title">name</div>
          <input type="text" placeholder="My Collection" />
        </div>

        <div className="addCollection__bar bar-color">
          <div className="addCollection__title">color</div>
          <div className="addCollection__colors w-100 d-flex flex-wrap" style = {{

          }}>
            {listColors.map(function (color) {
              return <div className="addCollection__color" style={{
                  width : "2rem",
                  height : "2rem",
                  backgroundColor : "transparent",
                  border : `3px solid ${color}`,
                  cursor: "pointer",
              }}></div>;
            })}
          </div>
        </div>

        <div className="addCollection__bar bar-custom-color">

        </div>

        <div className="addCollection__buttons">
            <button className="addCollection__button">Create</button>
            <button className="addCollection__button">Cancel</button>
        </div>
        </div>
      </div>
    </div>
  );
}
